 import React from "react";
import Avatar from "./AvaDecr/Avatar";
import NewPost from "./New post/NewPost";
import MyPosts from "./My posts/MyPosts";

 let postsData = [
     {post: 'Го по пиву пацаны'},
     {post: ')'}
 ]

const Profile = (props) => {

    let postElements =
        props.postsData.map( posts => <MyPosts post={posts.post} />);

    return (
        <div>
            <Avatar />
            <NewPost />
            {postElements}
        </div>
    );
}

export default Profile;
